import React, { useEffect, useState } from 'react'
import './NavBar.css';
import Button from './Button'
import { Link } from 'react-router-dom'
import { useAuthContext } from '../hooks/useAuthContext';
function NavBar() {
    const [click, setClick] = useState(false)
    const [button, setbutton] = useState(true)
    const { user } = useAuthContext()
    const closeMobileMenu = () => setClick(false)
    const handleClick = () => setClick(!click)

    const showButton = () => {
        if (window.innerWidth <= 960) {
            setbutton(false)
            closeMobileMenu(true)
        } else {
            setbutton(true)
        }
    }
    useEffect(() => {
        showButton()
    }
        , [])
    window.addEventListener('resize', showButton)
    return (
        <>
            <nav className="navbar">
                <div className="navbar-container">
                    <Link to='/' className="navbar-logo">
                        Will's Cleaning Service
                    </Link>
                    <img src="/videos/location.jpeg" className="location" />
                    <img src="/videos/images.png" className="location2" />
                    <h3 className='navbar-location'>Issaquah, WA</h3>

                    <div className='menu-icon' onClick={handleClick}>
                        <i className={click ? 'fa fa-times' : 'fas fa-bars'} />
                    </div>
                    <ul className={click ? 'nav-menu active' : 'nav-menu'}>

                        <li className='nav-item'>
                            <Link to='/' className="nav-links" onClick={closeMobileMenu}>
                                Home
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link to='/services' className="nav-links" onClick={closeMobileMenu}>
                                Services
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link to='/review' className="nav-links" onClick={closeMobileMenu}>
                                Reviews
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link to='/sign-up' className="nav-links" onClick={closeMobileMenu}>
                                {user && (
                                    <div>
                                        {button && <Button buttonStyle='btn--outline'>Sign In</Button>}
                                    </div>
                                )}
                                {button && <Button buttonStyle='btn--outline'>Sign Up</Button>}
                            </Link>
                        </li>
                    </ul>


                </div>



            </nav>
        </>
    )
}

export default NavBar
